import React from "react";
import { Link } from "react-router-dom";
import "./header.css";

function Header() {
  return (
    <>
      <div className="header">
        <div>
          <h1>Online Shoping Center</h1>
        </div>
        <div>
          <Link to="/">
            <img src="./pics/home"/>
          </Link>
        </div>
        <div>
          <Link to="/cart">
            <img src="./pics/cart.png" className="img" />
          </Link>
        </div>
      </div>
    </>
  );
}

export default Header;
